import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  return (
    <div style={{ padding: 32 }}>
      <h1>Galerías del Fotógrafo</h1>
      {/* Aquí irá la lista de galerías y el botón para crear una nueva */}
      <Link to="/watermark" style={{ marginRight: 16 }}>Configurar Marca de Agua</Link>
      <Link to="/gallery/nueva">Crear Nueva Galería</Link>
    </div>
  );
};

export default Dashboard;
